  true,\n\t\"url\": null,\n\t\"notes\": \"Service-Learning and Community Service in
  K-12 Public Schools, 1999 (FRSS 71), is a study that is part of the Fast Response
  Survey System (FRSS) program; program data is available since 1998-99 at http://nces.ed.gov/surveys/frss/downloads.asp.
  FRSS 71 http://nces.ed.gov/surveys/frss/index.asp is a cross-sectional study that
  was designed to assess the prevalence and support for service-learning programs
  in K-12 schools across the nation. This study was conducted using surveys of elementary,
  middle, and secondary/combined school principals. Public elementary schools (200),
  middle schools (500), and secondary/combined schools (1,300) were sampled. The study's
  unweighted response rate was 92 percent and the weighted response rate was 93 percent.
  Key statistics produced from FRSS 71 were on the prevalence of service-learning
  activities in K-12 schools.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
